const SearchBar = ({onSearch}) => {
   return (
      <div className="contenedor-search">
          <input className="search-input" type='search' />
         <button className="search-btn" onClick={() => onSearch}>Agregar</button> 
      </div>
   );
}

export default SearchBar;
